        /// <summary>
/// Gets the unit price.
/// </summary>
/// <param name="_exportDocumentLine">
/// The export document line buffer.
/// </param>
/// <returns>
/// The unit price.
/// </returns>
display public TaxIntgrExportDocumentUnitPrice_CN getUnitPrice(TaxIntgrExportDocumentLine_CN _exportDocumentLine)
{
    TaxIntgrExportDocumentSourceLine_CN exportDocumentLineSourceLocal;

    exportDocumentLineSourceLocal = _exportDocumentLine.joinChild();

    return TaxIntgrUtility_CN::calculateUnitPrice(
                exportDocumentLineSourceLocal.IsIncludeTax,
                _exportDocumentLine.TransactionCurrencyNetAmount,
                _exportDocumentLine.TransactionCurrencyTaxAmount,
                _exportDocumentLine.Qty);
}

